import React, { Component } from 'react';
import data from './data';
import './App.css';

class App extends Component {
  render() {
    return (
      <div id="root" className="container">
        <header className="header">
          <div className="brand">
            <a href="index.html">S cart</a>
          </div>
          <div className="header-links">
            <a href="cart.html">My cart</a>
            <a href="signin.html">Sign In</a>
          </div>
        </header>
        <section className="movie-app">
          <main>
            <ul className="products all-movies">
              {
                data.products.map(product => 
                  <li className="movie-list">
                    <div className="product">
                    <figure>
                        <a><img className="product-image movie-img" src={product.image} /></a>
                    </figure>
                    <figcaption>
                        <h1><a className="product-name movie-title">{product.name}</a></h1>
                        <span className="product-price movie-year">{product.price}</span>
                        <span className="product-brand movie-type">{product.brand}</span>
                    </figcaption>
                    </div>
                  </li>
                )
              }

            </ul>
          </main>
        </section>
      </div>
    );
  }
}

export default App;
